"use strict";

export class IconsetRegistry {
  constructor() {
    this.iconsetMap = new Map();
  }
  static getInstance() {
    return IconsetRegistry.instance || (IconsetRegistry.instance = new IconsetRegistry()), IconsetRegistry.instance;
  }
  addIconset(e, t) {
    this.iconsetMap.set(e, t);
    const n = new CustomEvent("sp-iconset-added", {
      bubbles: !0,
      composed: !0,
      detail: {
        name: e,
        iconset: t
      }
    });
    setTimeout(() => window.dispatchEvent(n), 0);
  }
  removeIconset(e) {
    this.iconsetMap.delete(e);
    const t = new CustomEvent("sp-iconset-removed", {
      bubbles: !0,
      composed: !0,
      detail: {
        name: e
      }
    });
    setTimeout(() => window.dispatchEvent(t), 0);
  }
  getIconset(e) {
    return this.iconsetMap.get(e);
  }
}
